import SearchBar from "../SearchBar/SearchBar";
import './NavbarElements.css'

const Navbar = () => {
   
 return (

    <header>
      <div color="dark" className="nav-area">
         <a href="/#" className="logo"> 
          Logo
         </a> 
         {/* <SearchBar /> */}
         
        
      </div>
    </header>

 );
};

export default Navbar;
